import React from 'react';


import '../style/winLoseDraw.css';
import Score from './Score';

const WinLoseDraw = (props) => {


    const wld = '';

    const test = () => {
        if (props.winLoseDraw === 'Win') {
            wld = 'win'
        }
        if (props.winLoseDraw === 'Lose') {
            wld = 'lose'
        }
        if (props.winLoseDraw === 'Draw') {
            wld = 'draw'
        }
    }

    props.endPicture



    return (
        <div className='wld' onClick={this.test}>

            {wld}

        </div>
    )
}




export default WinLoseDraw;
